import React from 'react';
import Footer from './Footer';
import Map from './Map';
import background from './nasa.jpg';
import {Parent} from "./AppStyles";

function App() {
  return (
      <Parent style={{backgroundImage: `url(${background})`}}>
          <React.Fragment>
              <Map/>
              <Footer/>
          </React.Fragment>
      </Parent>
  );
}

export default App;
